import { WarningTwoTone } from '@ant-design/icons';

const StripeCancel = () => {
    return (
        <div>
            <div>
                <WarningTwoTone  spin style={{ fontSize: "50px" }} />
            </div>
        </div>
    );
};

export default StripeCancel;
